    true,nt"url": null,nt"notes": "Operator Submission - Incident/Accident
    report data submitted to PHMSA by pipeline operators. Pipeline operators are required
    to submit incident reports within 30 days of a pipeline accident or incident. The
    key information that is collected contains; in-depth location information, facility
    and operating information, and cause of the accident and incident. Specific information
    includes the time and location of the incident, number of any injuries and/or fatalities,
    commodity spilled/gas released, causes of failure and evacuation procedures. Data
    sets are by following system types: 1) GD-Incident : Incident Report for Gas Distribution
    System, 2) GTGG-Incident: Incident Report for Natural and Other Gas Transmission
    and Gathering Systems, 3) HL-Incident:  Accident Report for Hazardous Liquid Pipeline
    Systems, and 4) LNG-Incident: Incident Report for Liquefied Natural Gas (LNG) Facilities.",nt"license_title":
